import hamburgerMenuIcon from '../media/hamboiga64x64.png';
import '../stylesheets/hamburgerMenu.css';
import React, {useState} from 'react';
import SideNavbar from "./SideNavbar";

const HamburgerMenu = ({width, height}) => {

    const [displaySideNavbar, setDisplaySideNavbar] = useState(false);

    return (
        <div>
            <img id="hamburgerMenu" style={{width: width, height: height}} onClick={() => {
                setDisplaySideNavbar(!displaySideNavbar);
            }} src={hamburgerMenuIcon}/>
            {displaySideNavbar ? <SideNavbar/> : null}
        </div>
    )
}

export default HamburgerMenu;
